(function($) {
    $(function(){
        // Initialize the jQuery File Upload plugin
        $('.upload').each(function(){
            var $this = $(this);
            var $_id = $(this).attr('data-id');
            $(this).fileupload({
                add: function (e, data) {
                    var $_id = data.form[0].id;
                    $('#gva-' + $_id + ' .loading').each(function(){
                            $(this).css('display', 'inline-block'); 
                    });
                    var jqXHR = data.submit().done(function(data){
                        data = JSON.parse(data);
                        $('#gva-' + $_id + ' .loading').each(function(){
                            $(this).css('display', 'none'); 
                        });
                        $('#gva-' + $_id + ' input.file-input').each(function(){
                            $(this).val(data['file_url']); 
                        });

                        $('#gva-' + $_id + ' .gavias-image-demo').each(function(){
                            $(this).attr('src', data['file_url_full']);
                        });

                        $('#gva-' + $_id + ' .gavias-field-upload-remove').each(function(){
                            $(this).css('display', 'inline-block');
                        });

                    });
                },

                progress: function(e, data){
                
                },
                fail: function(e, data){
                    // Something has gone wrong!
                    data.context.addClass('error');
                }
            });
        });
        $(document).ready(function () {
             gavias_load_images();
             gavias_choose_image();
        });

        function gavias_load_images(){
            $('.btn-get-images-upload').click(function(){
                $this = $(this);
                $.ajax({
                 url: drupalSettings.gavias_blockbuilder.get_images_upload_url,
                 type: 'POST',
                 success: function (data) {
                    
                    var html = '';
                    $.each(data['data'], function( index, value ) {
                        if(value['file_url_full'] != 'undefined' || value['file_url_full']){
                            html += '<a data-image="'+value['file_url']+'" data-image-demo="'+value['file_url_full']+'" class="btn-choose-image-upload" ><img src="'+value['file_url_full']+'"/></a>';
                        }
                    });
                   $this.parents('.gva-upload-image').find('.gavias-box-images .gavias-box-images-inner .list-images').each(function(){
                        $(this).html(html);
                        $(this).parents('.gavias-box-images').addClass('open-popup');
                    })
                },
                 error: function (jqXHR, textStatus, errorThrown) {
                   alert(textStatus + ":" + jqXHR.responseText);
                 }
              });
            });  
        }

        function gavias_choose_image(){

            $( ".gva-upload-image" ).delegate( ".btn-choose-image-upload", "click", function() {
                var file_url = $(this).attr('data-image');
                var file_url_full = $(this).attr('data-image-demo');
                $(this).parents('.gva-upload-image').find('input.file-input').each(function(){
                    $(this).val(file_url); 
                });

                $(this).parents('.gva-upload-image').find('.gavias-image-demo').each(function(){
                    $(this).attr('src', file_url_full);
                });

                $(this).parents('.gva-upload-image').find('.gavias-field-upload-remove').each(function(){
                    $(this).css('display', 'inline-block');
                });

                $(this).parents('.gavias-box-images').removeClass('open-popup');
            });

            $('.gva-upload-image .close').click(function(){
                $(this).parents('.gavias-box-images').removeClass('open-popup');
            });
        }

        // Helper function that formats the file sizes
        function formatFileSize(bytes) {
            if (typeof bytes !== 'number') {
                return '';
            }

            if (bytes >= 1000000000) {
                return (bytes / 1000000000).toFixed(2) + ' GB';
            }

            if (bytes >= 1000000) {
                return (bytes / 1000000).toFixed(2) + ' MB';
            }

            return (bytes / 1000).toFixed(2) + ' KB';
        }

    });

    $(document).ready(function(){
        $('.gavias-field-upload-remove').click(function(){
          $(this).parent().find('.gavias-image-demo').attr('src', $(this).attr("data-src"));
          $(this).parent().find('input.file-input').val('');
		  $(this).parent().find('input.imce-url-input').val('');
        })
    });

})(jQuery);;
jQuery(document).ready(function($){

	// sortable init
	$('.tabs-ul').hover(function(){
		$('.tabs-ul').sortable({ 
			cursor	: 'move',
			opacity	: 0.9
		});
	});
	
	
	// add
	$('.gbb-add-tab').click(function(){
		
		// increase tabs counter
		var tabs_counter = $(this).siblings('.gbb-tabs-count');
		tabs_counter.val(tabs_counter.val()*1 + 1);
		
		var name = $(this).attr('rel-name');
		var tabs_wrapper = $(this).siblings('.tabs-ul');
		var new_tab = tabs_wrapper.children('li.tabs-default').clone(true);

		new_tab.removeClass('tabs-default');	
		new_tab.children('input.title').attr('name',name+'[title][]');
		new_tab.children('input.icon').attr('name',name+'[icon][]');
		new_tab.children('textarea').attr('name',name+'[content][]');
		new_tab.children('textarea').addClass('code_html_tiny code_html_tiny_after_' + (tabs_counter.val()*1 + 1));

		tabs_wrapper
			.append( new_tab )
			.children('li:last')
				.fadeIn(500);

		tinymce.init({
        	selector: '#gbb-form-setting textarea.code_html_tiny_after_' + (tabs_counter.val()*1 + 1),
        	height: 300,
        	plugins: [
          'advlist autolink lists link image charmap anchor pagebreak media searchreplace code fullscreen',
          'emoticons textcolor textpattern colorpicker'
        	],
        	toolbar1: 'insertfile undo redo | styleselect | bullist numlist outdent indent | link image | forecolor backcolor emoticons',
      });		

	});
	
	// delete
	$('.gbb-remove-tab').click(function(e){
		e.preventDefault();
		
		// decrease tabs counter
		var tabs_counter = $(this).parents('div.field-content').children('.gbb-tabs-count');
		tabs_counter.val(tabs_counter.val()*1 - 1);
		
		$(this).parent().fadeOut(300, function(){$(this).remove();});
	});
	
});;
